            return(
                <div key={ i }>
                    <div><img alt="" key={ i } src={ image } /></div>
                    <div><button onClick={ this.props.editImageButtonClick } id={ image }>Edit Image</button><button onClick={ this.props.deleteImageButtonClick } id={ image }>Delete Image</button></div>
                </div>
            )
        })
        return(
            <div>
                { imageList1 }
            </div>
        )
    }
}

export default ImageList;
